var __index = {"config":{"lang":["en","ja"],"separator":"[\\s\\u200b\\-]","pipeline":["stemmer"]},"docs":[{"location":"index.html","title":"Hello, I'm Anxiu.","text":"<p> \u200b\u7ea6\u200b 240 \u200b\u4e2a\u200b\u5b57\u200b  \u200b\u9884\u8ba1\u200b\u9605\u8bfb\u200b\u65f6\u95f4\u200b 1 \u200b\u5206\u949f\u200b</p> <p>Gopher, also interesting in ML/IOT/Security Tech. Currently studying at MIEC, FZU. That's creating some interesting projects!</p> <p> Project</p> <p>The offline plugin adds support for building offline-capable documentation, so you can distribute the [<code>site</code> directory][mkdocs.site_dir] as a <code>.zip</code> file that can be downloaded.</p> <p> Project Collection</p> <p> Publication</p> <p>The meta plugin makes it easy to [boost][meta.search.boost] specific sections in search results or to [exclude][meta.search.exclude] them entirely from being indexed, giving more granular control over search.</p> <p> Publication List</p> <p>\u200b\u672c\u7ad9\u200b\u5171\u6709\u200b 10 \u200b\u4e2a\u200b\u9875\u9762\u200b\uff0c1800 \u200b\u4e2a\u200b\u5b57\u200b\uff0c140 \u200b\u884c\u200b\u4ee3\u7801\u200b\u3002</p> <p> \u200b\u6700\u8fd1\u200b\u66f4\u65b0\u200b /   \u200b\u7ad9\u70b9\u200b\u7edf\u8ba1\u200b</p> <p>\u200b\u9875\u9762\u200b\u603b\u6570\u200b\uff1a10 \u200b\u603b\u200b\u5b57\u6570\u200b\uff1a1800 \u200b\u4ee3\u7801\u200b\u5757\u200b\u884c\u6570\u200b\uff1a140 \u200b\u7f51\u7ad9\u200b\u8fd0\u884c\u200b\u65f6\u95f4\u200b\uff1a</p>"},{"location":"cs/index.html","title":"Computer Science","text":"<p> \u200b\u7ea6\u200b 22 \u200b\u4e2a\u200b\u5b57\u200b </p> <p>Abstract</p> <p>\u200b\u8ba1\u7b97\u673a\u79d1\u5b66\u200b\u76f8\u5173\u200b\uff0c\u200b\u4e3b\u8981\u200b\u4ee5\u200b\u7406\u8bba\u77e5\u8bc6\u200b\u4e3a\u4e3b\u200b\u3002</p>"},{"location":"cs/index.html#table-of-content","title":"Table of Content","text":""},{"location":"cs/lang/py/Python-venv.html","title":"Python Virtual Environment","text":"<p><code>venv</code>  \u200b\u662f\u200b python \u200b\u4e2d\u200b\u642d\u5efa\u200b\u865a\u62df\u73af\u5883\u200b\u7684\u200b\u4e00\u4e2a\u200b\u5de5\u5177\u200b\uff0c\u200b\u662f\u200b python virtual environments \u200b\u7279\u6027\u200b\u4e2d\u200b\u7684\u200b\u4e00\u90e8\u5206\u200b\uff0c\u200b\u6709\u65f6\u200b\u4e5f\u200b\u4f1a\u200b\u88ab\u200b\u7f29\u5199\u6210\u200b <code>virtualenv</code> </p> Text Only<pre><code>Python virtual environments allow you to install Python packages in an isolated location from the rest of your system instead of installing them system-wide. Let\u2019s look at how to use the Python venv, short for Python virtual environment, also abbreviated as\u00a0_virtualenv_.\n</code></pre> <p>\u200b\u4e2a\u4eba\u200b\u7406\u89e3\u200b\u4e0a\u200b\uff0c\u200b\u5b83\u200b\u7684\u200b\u4f5c\u7528\u200b\u7c7b\u4f3c\u200b\u4e8e\u200b\u524d\u7aef\u200b\u9879\u76ee\u200b\u4e2d\u200b\u7684\u200b <code>node_module</code>\uff0c\u200b\u5c06\u200b\u4f9d\u8d56\u200b\u5305\u200b\u5b89\u88c5\u200b\u5230\u200b\u9879\u76ee\u200b\u4f9d\u8d56\u200b\u8def\u5f84\u200b\u4e0b\u200b\u800c\u200b\u4e0d\u662f\u200b\u7cfb\u7edf\u200b\u4f9d\u8d56\u200b\u4e2d\u200b\u3002</p>"},{"location":"cs/lang/py/Python-venv.html#install","title":"Install","text":"<p>\u200b\u6267\u884c\u200b\u4ee5\u4e0b\u200b\u6307\u4ee4\u200b\u5b89\u88c5\u200b python virtual environment\uff0c</p> Python<pre><code>pip install virtualenv\n</code></pre> <p>\u200b\u4e5f\u200b\u53ef\u4ee5\u200b\u901a\u8fc7\u200b\u963f\u91cc\u200b\u4e91\u200b\u7684\u200b\u955c\u50cf\u200b\u8fdb\u884c\u200b\u5b89\u88c5\u200b\uff0c</p> Python<pre><code>pip install virtualenv -i http://mirrors.aliyun.com/pypi/simple/ --trusted-host mirrors.aliyun.com\n</code></pre>"},{"location":"cs/lang/py/Python-venv.html#get-started","title":"Get Started","text":"<p>\u200b\u4ee5\u4e0b\u200b\u662f\u200b\u865a\u62df\u73af\u5883\u200b\u7684\u200b\u7b80\u5355\u200b\u4f7f\u7528\u200b\uff0c\u200b\u7b14\u8005\u200b\u4f7f\u7528\u200b\u7684\u200b\u662f\u200b <code>win</code>\uff0c\u200b\u8def\u5f84\u200b\u81ea\u5df1\u200b\u6539\u6539\u200b\u5206\u9694\u7b26\u200b\u3002</p> Python<pre><code># \u200b\u521b\u5efa\u200b\u865a\u62df\u73af\u5883\u200b\n&lt;div markdown=\"1\" style=\"margin-top: -30px; font-size: 0.75em; opacity: 0.7;\"&gt;\n:material-circle-edit-outline: \u200b\u7ea6\u200b 312 \u200b\u4e2a\u200b\u5b57\u200b :fontawesome-solid-code: 55 \u200b\u884c\u200b\u4ee3\u7801\u200b :material-clock-time-two-outline: \u200b\u9884\u8ba1\u200b\u9605\u8bfb\u200b\u65f6\u95f4\u200b 2 \u200b\u5206\u949f\u200b\n&lt;/div&gt;\npython -m venv .\\venv\n# ./venv \u200b\u4e3a\u200b\u4f9d\u8d56\u200b\u521b\u5efa\u200b\u7684\u200b\u8def\u5f84\u200b\u3002\n</code></pre> <p>\u200b\u521b\u5efa\u200b\u5b8c\u6210\u200b\u540e\u200b\uff0c\u200b\u7ec8\u7aef\u200b\u8fdb\u5165\u200b\u865a\u62df\u73af\u5883\u200b\uff0c\u200b\u4f7f\u7528\u200b <code>.\\venv\\Scripts</code> \u200b\u4e0b\u200b\u7684\u200b <code>python.exe</code> \u200b\u4f5c\u4e3a\u200b\u89e3\u91ca\u5668\u200b\u3002\u200b\u7ec8\u7aef\u200b\u5c06\u4f1a\u200b\u51fa\u73b0\u200b\u7c7b\u4f3c\u200b\u4e8e\u200b <code>(venv)</code> \u200b\u7684\u200b\u5b57\u6837\u200b\uff0c\u200b\u663e\u793a\u200b\u5df2\u7ecf\u200b\u8fdb\u5165\u200b\u865a\u62df\u73af\u5883\u200b\u4e2d\u200b\u3002</p> <p></p> <p></p> <p>\u200b\u5982\u679c\u200b\u7ec8\u7aef\u200b\u6ca1\u6709\u200b\u6210\u529f\u200b\u8fdb\u5165\u200b\u865a\u62df\u73af\u5883\u200b\uff0c\u200b\u53ef\u4ee5\u200b\u4f7f\u7528\u200b <code>venv</code> \u200b\u751f\u6210\u200b\u7684\u200b\u811a\u672c\u200b\u8fdb\u884c\u200b\u542f\u52a8\u200b\uff0c</p> Bash<pre><code># For Windows OS,\n# In cmd.exe\n.\\venv\\Scripts\\activate.bat\n# In PowerShell\n.\\venv\\Scripts\\Activate.ps1\n\n# For Linux and MacOS, \nsource myvenv/bin/activate\n</code></pre> <p>\u200b\u4e00\u822c\u6765\u8bf4\u200b\uff0c\u200b\u6211\u4eec\u200b\u4f1a\u200b\u5c06\u200b\u865a\u62df\u73af\u5883\u200b\u547d\u540d\u200b\u4e3a\u200b <code>/venv</code>\uff0c\u200b\u8fd9\u4e2a\u200b\u6587\u4ef6\u5939\u200b\u4e2d\u5c06\u200b\u5305\u542b\u200b\u4ee5\u4e0b\u5185\u5bb9\u200b\u3002</p> Bash<pre><code># In windows OS\n.\n\u251c\u2500\u2500 Include\n\u251c\u2500\u2500 Lib\n\u2502   \u2514\u2500\u2500 site-packages\n\u251c\u2500\u2500 pyvenv.cfg\n\u2514\u2500\u2500 Scripts\n    \u251c\u2500\u2500 activate\n    \u251c\u2500\u2500 activate.bat\n    \u251c\u2500\u2500 Activate.ps1\n    \u251c\u2500\u2500 deactivate.bat\n    \u251c\u2500\u2500 pip3.10.exe\n    \u251c\u2500\u2500 pip3.exe\n    \u251c\u2500\u2500 pip.exe\n    \u251c\u2500\u2500 python.exe\n    \u2514\u2500\u2500 pythonw.exe\n\n# In Linux, \n.\n\u251c\u2500\u2500 bin\n\u2502   \u251c\u2500\u2500 activate\n\u2502   \u251c\u2500\u2500 activate.csh\n\u2502   \u251c\u2500\u2500 activate.fish\n\u2502   \u251c\u2500\u2500 easy_install\n\u2502   \u251c\u2500\u2500 easy_install-3.6\n\u2502   \u251c\u2500\u2500 pip\n\u2502   \u251c\u2500\u2500 pip3\n\u2502   \u251c\u2500\u2500 pip3.6\n\u2502   \u251c\u2500\u2500 python -&gt; /usr/bin/python\n\u2502   \u2514\u2500\u2500 python3 -&gt; python\n\u251c\u2500\u2500 include\n\u251c\u2500\u2500 lib\n\u2502   \u2514\u2500\u2500 python3.6\n\u2502       \u2514\u2500\u2500 site-packages\n\u251c\u2500\u2500 lib64 -&gt; lib\n\u2514\u2500\u2500 pyvenv.cfg\n</code></pre> <p><code>Lib/</code> \u200b\u4e2d\u200b\u5305\u542b\u200b\u7684\u200b\u662f\u200b\u4f9d\u8d56\u200b\u6587\u4ef6\u200b\uff0c<code>Scripts/</code> \u200b\u4e2d\u200b\u63d0\u4f9b\u200b\u4e86\u200b\u4e00\u7cfb\u5217\u200b\u7684\u200b\u8fd0\u884c\u200b\u811a\u672c\u200b\u548c\u200b\u4e8c\u8fdb\u5236\u200b\u6587\u4ef6\u200b\uff0c<code>pyenv.cfg</code> \u200b\u662f\u200b\u4e00\u4e9b\u200b\u53ef\u200b\u4fee\u6539\u200b\u914d\u7f6e\u200b\u9879\u200b\uff0c\u200b\u4f60\u200b\u53ef\u4ee5\u200b\u81ea\u5b9a\u4e49\u200b\u4f7f\u7528\u200b\u7684\u200b home Python Interpretation\u3002</p> <p>\u200b\u7ed3\u675f\u200b\u4f7f\u7528\u200b\u540e\u200b\u53ef\u4ee5\u200b\u9000\u51fa\u200b\u865a\u62df\u73af\u5883\u200b\uff0c\u200b\u4f7f\u7528\u200b\u4ee5\u4e0b\u200b\u6307\u4ee4\u200b\u5373\u53ef\u200b\u3002</p> Python<pre><code># \u200b\u9000\u51fa\u200b\u865a\u62df\u73af\u5883\u200b\ndeactivate\n</code></pre> Text Only<pre><code>title: \u200b\u53c2\u8003\u8d44\u6599\u200b\n- [Python venv: How To Create, Activate, Deactivate, And Delete \u2022 Python Land Tutorial](https://python.land/virtual-environments/virtualenv)\n- [\u200b\u4e3a\u200bpython\u200b\u9879\u76ee\u200b\u914d\u7f6e\u200b\u4e13\u5c5e\u200b\u865a\u62df\u73af\u5883\u200b - \u200b\u77e5\u4e4e\u200b (zhihu.com)](https://zhuanlan.zhihu.com/p/463314523)\n</code></pre>"},{"location":"ml/index.html","title":"Machine Learning","text":"<p> \u200b\u7ea6\u200b 12 \u200b\u4e2a\u200b\u5b57\u200b </p> <p>Abstract</p> <p>\u200b\u673a\u5668\u200b\u5b66\u4e60\u200b\u76f8\u5173\u200b\u3002</p>"},{"location":"ml/index.html#table-of-content","title":"Table of Content","text":""},{"location":"oth/index.html","title":"\u6742\u9879","text":"<p> \u200b\u7ea6\u200b 8 \u200b\u4e2a\u200b\u5b57\u200b </p> <p>Abstract</p> <p>\u200b\u968f\u7b14\u200b</p>"},{"location":"oth/index.html#table-of-content","title":"Table of Content","text":""},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html","title":"Build your MkDocs Site","text":"<p> \u200b\u7ea6\u200b 887 \u200b\u4e2a\u200b\u5b57\u200b  76 \u200b\u884c\u200b\u4ee3\u7801\u200b  \u200b\u9884\u8ba1\u200b\u9605\u8bfb\u200b\u65f6\u95f4\u200b 4 \u200b\u5206\u949f\u200b</p> <p>Mkdocs \u200b\u662f\u200b\u4e00\u4e2a\u200b\u4f7f\u7528\u200b python \u200b\u7f16\u5199\u200b\u7684\u200b\u9759\u6001\u200b\u535a\u5ba2\u200b\u751f\u6210\u200b\u8f6f\u4ef6\u200b\uff0c\u200b\u76f8\u6bd4\u200b\u4e8e\u200b <code>hugo</code>\uff0c<code>hexo</code>\u200b\u7b49\u200b\uff0c\u200b\u66f4\u52a0\u200b\u6ee1\u8db3\u200b\u6211\u200b\u7684\u200b\u9700\u6c42\u200b\u3002\u200b\u76f8\u5bf9\u6765\u8bf4\u200b\uff0c<code>Mkdocs</code>\u200b\u4f1a\u200b\u6bd4\u200b\u524d\u9762\u200b\u4e8c\u8005\u200b\u66f4\u52a0\u200b\u7b80\u6d01\u200b\uff0c\u200b\u4e0a\u200b\u624b\u200b\u96be\u5ea6\u200b\u5e94\u8be5\u200b\u4e5f\u200b\u4f1a\u200b\u66f4\u200b\u4f4e\u200b\u4e00\u70b9\u200b\u3002</p>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#installation","title":"Installation","text":"<p>\u200b\u56e0\u4e3a\u200b\u8fd9\u662f\u200b\u4e00\u4e2a\u200b python \u200b\u5e94\u7528\u200b\uff0c\u200b\u5b9e\u9645\u4e0a\u200b\u53ef\u4ee5\u200b\u76f4\u63a5\u200b\u901a\u8fc7\u200b <code>pip</code> \u200b\u5de5\u5177\u200b\u5c31\u200b\u53ef\u4ee5\u200b\u8fdb\u884c\u200b\u5b89\u88c5\u200b\u3002</p> <p>\u200b\u5b89\u88c5\u200b <code>Mkdocs</code>\uff0c</p> PowerShell<pre><code>pip install mkdocs\n</code></pre> <p>\u200b\u901a\u8fc7\u200b <code>pip</code> \u200b\u67e5\u770b\u200b <code>Mkdocs</code> \u200b\u7248\u672c\u200b\uff0c</p> PowerShell<pre><code>(venv) PS X:\\example&gt; pip show mkdocs\nName: mkdocs\nVersion: 1.5.3\nSummary: Project documentation with Markdown.\nHome-page:\nAuthor:\nAuthor-email: Tom Christie &lt;tom@tomchristie.com&gt;\nLicense:\nLocation: X:\\example\\venv\\Lib\\site-packages\nRequires: click, colorama, ghp-import, jinja2, markdown, markupsafe, mergedeep, packaging, pathspec, platformdirs, pyyaml, pyyaml-env-tag, watchdog\nRequired-by:\n</code></pre>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#commands","title":"Commands","text":"<p>\u200b\u4f7f\u7528\u200b <code>mkdocs -h</code> \u200b\u67e5\u770b\u200b\u5e2e\u52a9\u200b\u4fe1\u606f\u200b\u540e\u200b\uff0c\u200b\u53ef\u4ee5\u200b\u770b\u5230\u200b <code>mkdocs</code> \u200b\u63d0\u4f9b\u200b\u7684\u200b\u547d\u4ee4\u884c\u200b\u6307\u4ee4\u200b\u3002</p> PowerShell<pre><code>(venv) PS X:\\example&gt; mkdocs -h\nUsage: mkdocs [OPTIONS] COMMAND [ARGS]...\nMkDocs - Project documentation with Markdown.\nOptions:\n-V, --version         Show the version and exit.\n-q, --quiet           Silence warnings\n-v, --verbose         Enable verbose output\n--color / --no-color  Force enable or disable color and wrapping for the output. Default is auto-detect.\n-h, --help            Show this message and exit.\nCommands:\nbuild      Build the MkDocs documentation\nget-deps   Show required PyPI packages inferred from plugins in mkdocs.yml\ngh-deploy  Deploy your documentation to GitHub Pages\nnew        Create a new MkDocs project\nserve      Run the builtin development server\n</code></pre> <p>\u200b\u8fd9\u200b\u91cc\u9762\u200b\u9700\u8981\u200b\u7528\u5230\u200b\u7684\u200b\u4e3b\u8981\u200b\u6709\u200b\uff0c</p> <ul> <li><code>mkdocs new [dir-name]</code> - Create a new project. \u200b\u521b\u5efa\u200b\u65b0\u200b\u9879\u76ee\u200b\u6587\u4ef6\u200b\uff0c\u200b\u751f\u6210\u200b\u9879\u76ee\u200b\u7684\u200b\u7a7a\u767d\u200b\u5e03\u5c40\u200b\uff0c\u200b\u5176\u4e2d\u200b <code>mkdocs.yml</code> \u200b\u662f\u200b\u7ad9\u70b9\u200b\u7684\u200b\u914d\u7f6e\u6587\u4ef6\u200b\uff0c<code>docs/</code> \u200b\u76ee\u5f55\u200b\u662f\u200b\u6587\u6863\u200b\u7684\u200b\u6839\u76ee\u5f55\u200b\u3002</li> </ul> Python<pre><code>(venv) PS X:\\example\\site&gt; tree /f\n# Project layout\nmkdocs.yml        # The configuration file.\ndocs/\nindex.md        # The documentation homepage.\n</code></pre> <ul> <li> <p><code>mkdocs serve</code> - Start the live-reloading docs server. \u200b\u542f\u52a8\u200b\u5b9e\u65f6\u200b\u91cd\u8f7d\u200b\u7684\u200b\u6587\u6863\u200b\u670d\u52a1\u5668\u200b\u3002</p> </li> <li> <p><code>mkdocs build</code> - Build the documentation site. \u200b\u7f16\u8bd1\u200b\u6587\u6863\u200b\u7f51\u7ad9\u200b\u6e90\u7801\u200b\uff0c\u200b\u50a8\u5b58\u200b\u5728\u200b <code>site/</code> \u200b\u76ee\u5f55\u200b\u4e0b\u200b\uff0c\u200b\u4f46\u662f\u200b\u7b14\u8005\u200b\u63a8\u8350\u200b\u628a\u200b <code>site/</code> \u200b\u76ee\u5f55\u200b\u5199\u200b\u8fdb\u200b <code>.gitignore</code> \u200b\u6587\u4ef6\u200b\u4e2d\u200b\uff0c\u200b\u56e0\u4e3a\u200b\u8fdc\u7a0b\u200b\u4ed3\u5e93\u200b\u7684\u200b\u4e3b\u200b\u5206\u652f\u200b\u5b9e\u9645\u4e0a\u200b\u5e76\u4e0d\u9700\u8981\u200b\u8fd9\u200b\u4e00\u4e2a\u200b\u6587\u4ef6\u5939\u200b\uff0c\u200b\u5b83\u200b\u7684\u200b\u4f5c\u7528\u200b\u662f\u200b\u53ef\u4ee5\u200b\u5e2e\u52a9\u200b\u4f60\u200b\u79bb\u7ebf\u200b\u67e5\u770b\u200b\u7f51\u7ad9\u200b\u3002</p> </li> <li> <p><code>mkdocs gh-deploy</code> - Deploy your documentation to GitHub Pages. \u200b\u90e8\u7f72\u200b\u4f60\u200b\u7684\u200b\u6587\u6863\u200b\u5230\u200b GitHub Pages \u200b\u4e2d\u200b\u3002\u200b\u6b64\u5904\u200b <code>gh-deploy</code> \u200b\u6307\u4ee4\u200b\u7684\u200b\u4f5c\u7528\u200b\u662f\u200b\u6267\u884c\u200b\u7f16\u8bd1\u200b\uff0c\u200b\u5e76\u200b\u5c06\u200b\u7f16\u8bd1\u200b\u540e\u200b\u7684\u200b\u7ed3\u679c\u200b commit \u200b\u5230\u200b\u4ed3\u5e93\u200b\u7684\u200b <code>gh-deploy</code> \u200b\u5206\u652f\u200b\u4e2d\u200b\u3002\u200b\u8fd9\u200b\u4e5f\u200b\u662f\u200b\u4e3b\u200b\u5206\u652f\u200b\u5e76\u4e0d\u9700\u8981\u200b\u5411\u200b\u8fdc\u7a0b\u200b\u4ed3\u5e93\u200b\u63d0\u4ea4\u200b <code>site/</code> folder \u200b\u7684\u200b\u539f\u56e0\u200b\u3002</p> </li> </ul>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#get-start","title":"Get Start","text":"<p>\u200b\u4f7f\u7528\u200b <code>mkdocs new</code> \u200b\u6307\u4ee4\u200b\u521b\u5efa\u200b\u9879\u76ee\u200b\u5e76\u200b\u8fdb\u5165\u200b\u9879\u76ee\u200b\u5730\u5740\u200b\uff0c</p> PowerShell<pre><code>PS X:\\anxiu&gt; mkdocs new site\nINFO    -  Creating project directory: site\nINFO    -  Writing config file: site\\mkdocs.yml\nINFO    -  Writing initial docs: site\\docs\\index.md\nPS X:\\anxiu&gt; cd .\\site\\\n</code></pre> <p>??? \u200b\u6211\u200b\u63a8\u8350\u200b\u4f7f\u7528\u200b python \u200b\u7684\u200b virtual environment \u200b\u529f\u80fd\u200b\u505a\u5230\u200b\u73af\u5883\u200b\u7684\u200b\u9694\u79bb\u200b\uff0c\u200b\u65b9\u4fbf\u200b\u6392\u67e5\u200b\u5305\u62ec\u200b\u4f9d\u8d56\u200b\u7248\u672c\u200b\u4e4b\u7c7b\u200b\u7684\u200b\u95ee\u9898\u200b\uff0c\u200b\u8be6\u7ec6\u200b\u5185\u5bb9\u200b\u53ef\u4ee5\u200b\u67e5\u770b\u200b Python-venv\uff0c</p> Python<pre><code># \u200b\u521b\u5efa\u200b\u865a\u62df\u73af\u5883\u200b\uff0c\nPS X:\\anxiu\\site&gt; python -m venv .\\venv\n# \u200b\u542f\u52a8\u200b\u865a\u62df\u73af\u5883\u200b\uff0c\n# \u200b\u5bf9\u4e8e\u200b Windows OS,\n# \u200b\u5982\u679c\u200b\u4f7f\u7528\u200b cmd.exe\n.\\venv\\Scripts\\activate.bat\n# \u200b\u5982\u679c\u200b\u4f7f\u7528\u200b PowerShell\n.\\venv\\Scripts\\Activate.ps1\n# \u200b\u5bf9\u4e8e\u200b Linux or MacOS, \nsource myvenv/bin/activate\n# \u200b\u8fdb\u5165\u200b\u5230\u200b venv \u200b\u4e2d\u200b\uff0c\n(venv) PS X:\\anxiu\\site&gt;\n</code></pre> <p>\u200b\u5f53\u7136\u200b\uff0c\u200b\u5982\u679c\u200b\u4f7f\u7528\u200b\u4e86\u200b\uff0c\u200b\u8bb0\u5f97\u200b\u628a\u200b <code>/venv</code> \u200b\u52a0\u200b\u5230\u200b <code>.gitignore</code> \u200b\u91cc\u200b\u3002</p> <p>\u200b\u8dd1\u200b\u8d77\u6765\u200b\u770b\u200b\u4e00\u773c\u200b\uff0c</p> PowerShell<pre><code>(venv) PS X:\\anxiu\\site&gt; mkdocs serve\nINFO    -  Building documentation...\nINFO    -  Cleaning site directory\nINFO    -  Documentation built in 0.26 seconds\nINFO    -  [06:39:44] Watching paths for changes: 'docs', 'mkdocs.yml'\nINFO    -  [06:39:44] Serving on http://127.0.0.1:8000/\n</code></pre> <p>\u200b\u8fdb\u5165\u200b\u672c\u5730\u200b 8000 \u200b\u7aef\u53e3\u200b\u67e5\u770b\u200b\uff0c</p> <p></p> <p>\u200b\u8fd9\u662f\u200b\u6211\u4eec\u200b\u7684\u200b\u7ad9\u70b9\u200b\u5c31\u200b\u5df2\u7ecf\u200b\u521d\u59cb\u5316\u200b\u6210\u529f\u200b\u4e86\u200b\uff0c\u200b\u4f46\u200b\u6211\u4eec\u200b\u8fd8\u200b\u9700\u8981\u200b\u628a\u200b\u5b83\u200b\u90e8\u7f72\u200b\u4f5c\u4e3a\u200b\u4e00\u4e2a\u200b\u5728\u7ebf\u200b\u670d\u52a1\u200b\u4f7f\u7528\u200b\u3002\u200b\u8fd9\u91cc\u200b\u4ee5\u200b GitHub Pages \u200b\u4e3e\u4f8b\u200b(\u200b\u6bd5\u7adf\u200b\u5f88\u96be\u200b\u627e\u5230\u200b\u63d0\u4f9b\u200b\u9759\u6001\u200b\u7f51\u9875\u200b\u663e\u793a\u200b\u7684\u200b\u514d\u8d39\u200b\u4e91\u200b\u670d\u52a1\u200b\u4e86\u200b)</p> <p>\u200b\u521d\u59cb\u5316\u200b <code>git</code> \u200b\u5e76\u200b\u6dfb\u52a0\u200b\u8fdc\u7a0b\u200b\u4ed3\u5e93\u200b\u5730\u5740\u200b\uff0c</p> Bash<pre><code>git init\ngit remote add origin &lt;repo_addr&gt;\n# For example, \n# git remote add origin git@github.com:Anxiu0101/note.git\n</code></pre> <p>add, commit, push \u200b\u4e00\u6c14\u5475\u6210\u200b\uff0c</p> Bash<pre><code>git add .\ngit commit -m \"build: init project\"\ngit push origin master\n</code></pre> <p>\u200b\u7136\u540e\u200b\u4f7f\u7528\u200b <code>mkdocs gh-deploy</code> \u200b\u6765\u200b\u521b\u5efa\u200b\u7f16\u8bd1\u200b\u540e\u200b\u7684\u200b\u7ed3\u679c\u200b\u5206\u652f\u200b\uff0c</p> Bash<pre><code>mkdocs gh-deploy\n</code></pre> <p>\u200b\u8be5\u200b\u6307\u4ee4\u200b\u7f16\u8bd1\u200b\u6587\u4ef6\u200b\u4e3a\u200b\u9759\u6001\u200b\u9875\u9762\u200b\u7f51\u7ad9\u200b\u5230\u200b <code>gh-deploy</code> \u200b\u5206\u652f\u200b\u5e76\u200b\u63a8\u9001\u200b\u5230\u200b\u8fdc\u7a0b\u200b\u4ed3\u5e93\u200b\u3002\u200b\u73b0\u5728\u200b\u5c31\u200b\u53ea\u200b\u9700\u8981\u200b\u5f00\u542f\u200b\u8fdc\u7a0b\u200b\u4ed3\u5e93\u200b\u7684\u200b GitHub Page \u200b\u529f\u80fd\u200b\u5e76\u200b\u6307\u5b9a\u200b\u5206\u652f\u200b\u5373\u53ef\u200b\uff0c\u200b\u5177\u4f53\u64cd\u4f5c\u200b\u5982\u4e0b\u200b\uff0c</p> <p></p> <p>\u200b\u7a0d\u7b49\u7247\u523b\u200b\uff0c\u200b\u5237\u65b0\u200b\u9875\u9762\u200b\u540e\u200b\u70b9\u51fb\u200b Visit site \u200b\u6309\u94ae\u200b\u5373\u53ef\u200b\u67e5\u770b\u200b\u9875\u9762\u200b\u3002</p>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#theme-configurations","title":"Theme &amp; Configurations","text":"<p>\u200b\u63a8\u8350\u200b <code>material</code> \u200b\u4e3b\u9898\u200b\uff0c\u200b\u867d\u7136\u200b\u5b98\u7f51\u200b\u6709\u4e9b\u200b\u529f\u80fd\u200b\u8981\u6c42\u200b\u8d5e\u52a9\u200b\u540e\u200b\u624d\u80fd\u200b\u4f7f\u7528\u200b\uff0c\u200b\u4f46\u662f\u200b\u793e\u533a\u200b\u7248\u200b\u63d0\u4f9b\u200b\u7684\u200b\u529f\u80fd\u200b\u5df2\u7ecf\u200b\u8db3\u591f\u200b\u4e86\u200b\u3002</p> <p>TODO fill with this part of content. mainly related to the <code>mkdocs.yml</code> file and material t</p> Python<pre><code>pip install mkdocs-material\npip install mkdocs-glightbox\npip install mkdocs-rss-plugin\npip install mkdocs-statistics-plugin\npip install mkdocs-git-revision-date-localized-plugin\n</code></pre>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#material-social-plugin","title":"material \u200b\u4e2d\u200b social plugin \u200b\u7684\u200b\u4f7f\u7528\u200b\u5f02\u5e38\u200b\u95ee\u9898","text":"<p>\u200b\u5982\u679c\u200b\u4f60\u200b\u5f00\u542f\u200b\u4e86\u200b material \u200b\u4e2d\u200b\u7684\u200b\u4e00\u4e2a\u200b\u540d\u4e3a\u200b social \u200b\u7684\u200b\u5185\u7f6e\u200b\u63d2\u4ef6\u200b\uff0c\u200b\u4f5c\u7528\u200b\u662f\u200b\u4e3a\u200b\u6bcf\u4e2a\u200b\u9875\u9762\u200b\u751f\u6210\u200b\u4e00\u5f20\u200b\u5361\u7247\u200b\uff0c\u200b\u8fbe\u6210\u200b\u901a\u8fc7\u200b\u5206\u4eab\u200b\u5361\u7247\u200b\u7684\u200b\u65b9\u5f0f\u200b\u5728\u200b\u793e\u4ea4\u200b\u5a92\u4f53\u200b\u4e2d\u200b\u5ba3\u4f20\u200b\u3002\u200b\u53ef\u80fd\u200b\u9047\u5230\u200b\u62a5\u9519\u200b\uff0c\u200b\u62a5\u9519\u200b\u90e8\u5206\u200b\u4fe1\u606f\u200b\u5982\u4e0b\u200b\uff0c</p> Markdown<pre><code>Required dependencies of \"social\" plugin not found. Install with: pip install pillow cairosvg\n</code></pre> <p>\u200b\u8fd9\u200b\u6d89\u53ca\u200b\u5230\u200b\u56fe\u7247\u200b\u751f\u6210\u200b\u8fd9\u4e2a\u200b\u529f\u80fd\u200b\uff0c\u200b\u800c\u200b\u5b83\u200b\u9700\u8981\u200b\u4e24\u4e2a\u200b\u76f8\u5e94\u200b\u7684\u200b\u5305\u200b <code>pillow</code> \u200b\u548c\u200b <code>cairosvg</code> \u200b\u4ece\u800c\u200b\u6b63\u5e38\u200b\u5de5\u4f5c\u200b\u3002\u200b\u5b98\u7f51\u200b\u76f8\u5e94\u200b\u90e8\u5206\u200b\u63d0\u5230\u200b\u4e86\u200b\u8fd9\u4e2a\u200b\u95ee\u9898\u200b\uff0c\u200b\u89e3\u51b3\u200b\u65b9\u5f0f\u200b\u5c31\u662f\u200b\u76f4\u63a5\u200b\u6267\u884c\u200b\u5982\u4e0b\u200b\u6307\u4ee4\u200b\uff0c\u200b\u5b89\u88c5\u200b\u4f9d\u8d56\u200b\u5305\u200b\u5373\u53ef\u200b\uff0c</p> <p>PowerShell<pre><code>pip install \"mkdocs-material[imaging]\"\n</code></pre> \u200b\u5f53\u7136\u200b\u4f60\u200b\u4e5f\u200b\u53ef\u4ee5\u200b\u6839\u636e\u200b\u62a5\u9519\u200b\u4fe1\u606f\u200b\u5206\u522b\u200b\u5b89\u88c5\u200b\u5bf9\u5e94\u200b\u5305\u200b\uff0c\u200b\u4e24\u4e2a\u200b\u65b9\u5f0f\u200b\u6ca1\u6709\u200b\u533a\u522b\u200b\u3002</p>"},{"location":"oth/blog/Build%20your%20personal%20MkDocs%20Site.html#plugins","title":"Plugins","text":"<p>mkdocs-git-revision-date-localized-plugin (timvink.github.io)</p> <p>MkDocs RSS Plugin (guts.github.io)</p> <p>https://wohugb.github.io/pymdown-extensions/</p> <p>https://juejin.cn/post/7273037222437208064</p> <p>https://hellowac.github.io/mkdocs-docs-zh/user-guide/plugins/</p> <p>https://github.com/Python-Markdown/markdown/wiki/Third-Party-Extensions</p> <p>https://github.com/squidfunk/mkdocs-material</p> <p>squidfunk.github.io</p> <p>Setting up social cards - Material for MkDocs (squidfunk.github.io)</p> <p>unverbuggt/mkdocs-encryptcontent-plugin: A MkDocs plugin that encrypt/decrypt markdown content with AES (github.com)</p> <p>matheart.github.io</p> <p>TonyCrane/mkdocs-toolchain: My personal mkdocs toolchain (github.com)</p> <p>TonyCrane/note: TonyCrane's Public Notebook (github.com)</p> <p>https://www.cnblogs.com/yang877/p/5860798.html</p>"},{"location":"oth/blog/Markdown-Grammar.html","title":"Markdown Grammar","text":"<p> \u200b\u7ea6\u200b 96 \u200b\u4e2a\u200b\u5b57\u200b  2 \u200b\u884c\u200b\u4ee3\u7801\u200b </p> <p>This is a test file for checking the correct working grammar of markdown.</p> <p>The first type is inline formats, including bold, italic, <code>inline code</code>, highlight, strikethrough, \\(inline formula\\)  and also the underline. The signal also need to test like ^1^<sub>1</sub>.</p> <p>After that, the block components:</p>"},{"location":"oth/blog/Markdown-Grammar.html#quote","title":"Quote","text":"<p>quote</p> <p>multiple line</p>"},{"location":"oth/blog/Markdown-Grammar.html#code-fences","title":"Code Fences","text":"Go<pre><code>code fences\nlog.print(\"go working.\")\n</code></pre>"},{"location":"oth/blog/Markdown-Grammar.html#math-block","title":"Math Block","text":"\\[ Latex \\\\ Math\\ Block \\]"},{"location":"oth/blog/Markdown-Grammar.html#table","title":"Table","text":"Header Key Description or Value The table key like id and the value."},{"location":"oth/blog/Markdown-Grammar.html#comment","title":"Comment","text":""},{"location":"oth/blog/Markdown-Grammar.html#link-references-and-footnotes","title":"Link References and Footnotes","text":"<p>Link References<sup>1</sup></p> <p>[1]: Link Reference</p> <p>Footnotes,</p>"},{"location":"oth/blog/Markdown-Grammar.html#list","title":"List","text":"<ol> <li>ordered list</li> <li>the part 2</li> <li>the 2.1</li> </ol> <ul> <li>unordered list</li> <li>another one</li> <li> <p>and different level.</p> </li> <li> <p> task list</p> </li> <li> finished</li> </ul> <ol> <li> <p>Footnotes\u00a0\u21a9</p> </li> </ol>"},{"location":"oth/blog/MkDocs.html","title":"Welcome to MkDocs","text":"<p> \u200b\u7ea6\u200b 195 \u200b\u4e2a\u200b\u5b57\u200b  7 \u200b\u884c\u200b\u4ee3\u7801\u200b  \u200b\u9884\u8ba1\u200b\u9605\u8bfb\u200b\u65f6\u95f4\u200b 1 \u200b\u5206\u949f\u200b</p> <p>For full documentation visit mkdocs.org.</p>"},{"location":"oth/blog/MkDocs.html#commands","title":"Commands","text":"<ul> <li><code>mkdocs new [dir-name]</code> - Create a new project.</li> <li><code>mkdocs serve</code> - Start the live-reloading docs server.</li> <li><code>mkdocs build</code> - Build the documentation site.</li> <li><code>mkdocs -h</code> - Print help message and exit.</li> </ul>"},{"location":"oth/blog/MkDocs.html#project-layout","title":"Project layout","text":"Text Only<pre><code>mkdocs.yml    # The configuration file.\ndocs/\n    index.md  # The documentation homepage.\n    ...       # Other markdown pages, images and other files.\n</code></pre> <p>\u200b\u642d\u5efa\u200b\u73af\u5883\u200b</p> <p>\u200b\u76f4\u63a5\u200b git clone</p> <p>\u200b\u5173\u4e8e\u200b material \u200b\u4e3b\u9898\u200b</p> <p>\u200b\u76f4\u63a5\u200b\u5b89\u88c5\u200b\u65f6\u200b\u9047\u5230\u200b\u4e86\u200b\u95ee\u9898\u200b\u6ca1\u200b\u6392\u67e5\u200b\u6210\u529f\u200b\uff0c\u200b\u4e8e\u662f\u200b\u91c7\u7528\u200b python venv \u200b\u7684\u200b\u65b9\u5f0f\u200b\u642d\u5efa\u200b\uff0c\u200b\u5e76\u200b\u5728\u200b\u9879\u76ee\u200b\u4e2d\u200b\u589e\u52a0\u200b requirement \u200b\u7684\u200b txt \u200b\u6587\u4ef6\u200b\u3002</p> Python<pre><code>pip install mkdocs-material\npip install mkdocs-glightbox\npip install mkdocs-rss-plugin\npip install mkdocs-statistics-plugin\npip install mkdocs-git-revision-date-localized-plugin\n</code></pre> <p>You might meet the error like following during open the social plugin, it means you need some dependency libs to enable the function of card generation. Just install iot. Bash<pre><code>Required dependencies of \"social\" plugin not found. Install with: pip install pillow cairosvg\n</code></pre></p> <p>The official document also support this content, Bash<pre><code>pip install \"mkdocs-material[imaging]\"\n</code></pre> Actually, both of them are same one. https://squidfunk.github.io/mkdocs-material/plugins/requirements/image-processing/</p>"},{"location":"oth/blog/MkDocs.html#plugins","title":"Plugins","text":"<p>mkdocs-git-revision-date-localized-plugin (timvink.github.io)</p> <p>MkDocs RSS Plugin (guts.github.io)</p> <p>https://wohugb.github.io/pymdown-extensions/</p> <p>https://juejin.cn/post/7273037222437208064</p> <p>https://hellowac.github.io/mkdocs-docs-zh/user-guide/plugins/</p> <p>https://github.com/Python-Markdown/markdown/wiki/Third-Party-Extensions</p> <p>https://github.com/squidfunk/mkdocs-material</p> <p>squidfunk.github.io</p> <p>Setting up social cards - Material for MkDocs (squidfunk.github.io)</p> <p>unverbuggt/mkdocs-encryptcontent-plugin: A MkDocs plugin that encrypt/decrypt markdown content with AES (github.com)</p> <p>matheart.github.io</p> <p>TonyCrane/mkdocs-toolchain: My personal mkdocs toolchain (github.com)</p> <p>TonyCrane/note: TonyCrane's Public Notebook (github.com)</p> <p>https://www.cnblogs.com/yang877/p/5860798.html</p>"},{"location":"sec/index.html","title":"Security","text":"<p> \u200b\u7ea6\u200b 9 \u200b\u4e2a\u200b\u5b57\u200b </p> <p>Abstract</p> <p>\u200b\u5b89\u5168\u200b\u76f8\u5173\u200b</p>"},{"location":"sec/index.html#table-of-content","title":"Table of Content","text":""},{"location":"web/index.html","title":"Web Development","text":"<p> \u200b\u7ea6\u200b 19 \u200b\u4e2a\u200b\u5b57\u200b </p> <p>Abstract</p> <p>\u200b\u7f51\u7edc\u200b\u5f00\u53d1\u200b\u76f8\u5173\u200b\uff0c\u200b\u4e3b\u8981\u200b\u4e3a\u200b <code>Golang</code> \u200b\u6280\u672f\u200b\u6808\u200b\u3002</p>"},{"location":"web/index.html#table-of-content","title":"Table of Content","text":""}]}